starcoder-response:
name: Add epel repo

Answer: yum_repository:
  name: epel
  description: EPEL YUM repo
  baseurl: https://download.fedoraproject.org/pub/epel/epel-release-latest-{{ ansible_distribution_major_version
    }}.noarch.rpm
  gpgcheck: true
  gpgkey: https://dl.fedoraproject.org/pub/epel/RPM-GPG-KEY-EPEL-{{ ansible_distribution_major_version
    }}
  enabled: true

name: Download Python 3.6

Answer: get_url:
  url: https://www.python.org/ftp/python/{{ python_release }}/{{ python_tarball }}
  dest: /tmp/{{ python_tarball }}
  checksum: sha256:32019981d6111c0311317311902e0799919119032b13263641012719109213b
when: python_version == 3.6

output:
  }} to {{ kubeshark_install_dir }}/kubeshark_{{ kubeshark_ver }}_{{ kubeshark_platform
  }}
become: true
become_user: root
get_url:
  url: '{{ kubeshark_mirror }}/{{ kubeshark_ver }}/kubeshark_{{ kubeshark_platform
    }}'
  dest: '{{ kubeshark_install_dir }}/kubeshark_{{ kubeshark_ver }}_{{ kubeshark_platform
    }}'
  checksum: '{{ kubeshark_checksums[kubeshark_ver][kubeshark_platform] }}'
  mode: 493

pkgng:
  name: ''
  state: present
with_items: '{% if ansible_os_family == ''FreeBSD'' %}[ ''vim-lite'', ''emacs-nox11''
  ]{% elif ansible_os_family == ''OpenBSD'' %}[ ''vim--no_x11'', ''emacs-24.5p5-no_x11''
  ]{% else %}[ ''vim'', ''emacs'' ]{% endif %}'

ansible.builtin.shell:
  cmd: 'cd /tmp

    unzip {{ op_deployment_url | basename }}

    cp op {{ op_deployment_installation_path }}/{{ op_deployment_bin }}

    chmod +x {{ op_deployment_installation_path }}/{{ op_deployment_bin }}

    '
when: (op_exists.stat.exists is false) or (op_deployment_force_update is true)

starcoder-response:
name: Build and install

Answer: shell: cd {{ ansible_env.HOME }}/nagios/nagios-{{ nagios_version }} && make all creates={{
  ansible_env.HOME }}/nagios/nagios-{{ nagios_version }}/nagios

output:
stat: path='{{ java_usr_folder }}/{{ java_folder_name }}-{{ java_version }}.0.{{ java_update
  }}+{{ java_build }}/release'
register: java_installed

