name: PHP | install packages to allow download from ssl urls.

Answer: apt:
  pkg: ''
  state: present
with_items: php{{ php_version_prefix }}{{ php_repo_suffix }}-curlphp{{ php_version_prefix
  }}{{ php_repo_suffix }}-gmpphp{{ php_version_prefix }}{{ php_repo_suffix }}-jsonphp{{
  php_version_prefix }}{{ php_repo_suffix }}-mbstringphp{{ php_version_prefix }}{{ php_repo_suffix
  }}-mysqlndphp{{ php_version_prefix }}{{ php_repo_suffix }}-opcache
when: php_enable_opcache and php_opcache_version!= php_default_opcache_version
notify: restart webserver

